import React from "react";
import MealTypeStatic from "./data/MealTypeStatic";

const Recipe = () => {
  const recipeObj = MealTypeStatic[1];
  return (
    <>
      <div className="row">
        <div className="col-5">
          <img src={recipeObj.image}></img>
        </div>
        <div className="col-7">
          <p>Words</p>
        </div>
      </div>
    </>
  );
};

export default Recipe;
